import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {App} from './App';
import reportWebVitals from './reportWebVitals';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from "react-router-dom";
import {PostList,Post} from "./components/Post";
import Home from "./components/home";
export const postsData = [{ id:1, t: 'asdda', con: 'sdfdsafsdf'}, { id: 2, t: 'asdda2', con: 'sdfdsafsdf2'}];

let app = (
    <Router>
        <div>
            <div className="title">
                <section className="table">
                    <App page="/" name="left_title" id="home" path="#Home" content="Home"/>
                    <App page="/about_me" name="left_title" id="aboutme" content="About Me"/>
                    <App page="/new_post" name="left_title" id="nan1" content="New Post"/>
                    <App page="/new_post" name="left_title" id="nan2" content="Post"/>
                    <App page="/new_post" name="left_title" content="Contact Me"/>
                    <App page="/login" name="right_title" id="login" content="Login"/>
                </section>
            </div>
            <Switch>
                <Route path="/login">
                    <div>
                        <PostList posts = {postsData} />
                    </div>
                </Route>
                <Route path="/new_post">
                    <PostList />
                </Route>
                <Route path="/about_me">
                    <PostList />
                </Route>
                <Route path="/">
                    <Home />
                </Route>
            </Switch>
        </div>
    </Router>
);


ReactDOM.render(
    app,
    document.getElementById('root1')
);


// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
